import React from 'react';
import 'antd/dist/antd.css';
import './custom.css'
import { List, Card , Button} from 'antd';
import store from "store";
import Layout from '../Layout/Layout';
export default class Homepage extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      user: '',
      pass: ''
    };
    
  }

  render() {
    const data = [
      {
        title: 'Title 1',
      },
      {
        title: 'Title 2',
      },
      {
        title: 'Title 3',
      },
      {
        title: 'Title 4',
      },
      {
        title: 'Title 1',
      },
      {
        title: 'Title 2',
      },
      {
        title: 'Title 3',
      },
      {
        title: 'Title 4',
      },
      {
        title: 'Title 1',
      },
      {
        title: 'Title 2',
      },
      {
        title: 'Title 3',
      },
      {
        title: 'Title 4',
      },
    ];

    return (
      <Layout>
        <List
          grid={{ gutter: 16, column: 4 }}
          dataSource={data}
          pagination={{
            onChange: page => {
              console.log(page);
            },
            pageSize: 12,
          }}
          renderItem={item => (
            <List.Item>
              <Card hoverable style={{ width: 300 }} title={item.title} cover={<img alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" />}>Card content</Card>
            </List.Item>
          )}
        />
      </Layout>
      
    );
  }
}
